import react from "react";
import axios from "axios";

const Articlecopy = () => {
  const handleSubmit = () => {
    let title = "second";
    let description = "deconf";
    let markdown = "ddd";
    let author = "ddd";

    axios
      .post("/add-new-article", {
        title,
        description,
        markdown,
        author,
      })
      .then((res) => console.log(`submitted`))
      .catch((err) => console.log("error in button"));
  };
  return <button onClick={handleSubmit}> Click here </button>;
};

export default Articlecopy;
